t;Can&#039;t Wait!&quot; &gt;Can&#039;t Wait!&lt;/option&gt;     \n             &lt;option value=&quot;Sorry To Miss Out&quot; &gt;Sorry To Miss Out&lt;/option&gt;     \n        &lt;/select&gt;\n    &lt;/div&gt;\n&lt;/div&gt;\n\n&lt;!-- Select List --&gt;\n&lt;div class=&quot;col-6&quot;&gt;\n    &lt;div class=&quot;form-group&quot;&gt;\n        &lt;label  class=&quot;form-label&quot; for=&quot;selectlist_2&quot;&gt;Persons will atend&lt;/label&gt;\n        &lt;select id=&quot;selectlist_2&quot; name=&quot;selectlist_2[]&quot; data-alias=&quot;&quot; class=&quot;form-select&quot;&gt;\n            &lt;option value=&quot;&quot; disabled selected&gt;-Select-&lt;/option&gt;\n             &lt;option value=&quot;1&quot; &gt;1&lt;/option&gt;     \n             &lt;option value=&quot;2&quot; &gt;2&lt;/option&gt;     \n        &lt;/select&gt;\n    &lt;/div&gt;\n&lt;/div&gt;\n\n&lt;!-- Text --&gt;\n&lt;div class=&quot;col-12&quot;&gt;\n    &lt;div class=&quot;form-group&quot;&gt;\n        &lt;label  class=&quot;form-label&quot; for=&quot;text_3&quot;&gt;Guest Name&lt;/label&gt;\n        &lt;input type=&quot;text&quot; id=&quot;text_3&quot; name=&quot;text_3&quot; value=&quot;&quot; data-alias=&quot;&quot; class=&quot;form-control&quot;&gt;\n    &lt;/div&gt;\n&lt;/div&gt;\n\n&lt;!-- Text Area --&gt;\n&lt;div class=&quot;col-12&quot;&gt;\n    &lt;div class=&quot;form-group&quot;&gt;\n        &lt;label  class=&quot;form-label&quot; for=&quot;textarea_1&quot;&gt;Any special dietary requirements&lt;/label&gt;\n        &lt;textarea id=&quot;textarea_1&quot; name=&quot;textarea_1&quot; rows=&quot;3&quot; data-alias=&quot;&quot; class=&quot;form-control&quot;&gt;&lt;/textarea&gt;\n    &lt;/div&gt;\n&lt;/div&gt;\n\n&lt;!-- Snippet --&gt;\n&lt;div class=&quot;snippet col-12&quot;&gt;&lt;p&gt;&lt;strong&gt;How to get there!&lt;/strong&gt;&lt;/p&gt;\n&lt;p&gt;&lt;small&gt;The Francis Marion Hotel 387 King Street Charleston. South Carolina.&lt;/small&gt;&lt;/p&gt;\n&lt;div id=&quot;map&quot; style=&quot;width: 100%; height: 300px; margin-bottom: 15px; background-color: #f3f5f7;&quot;&gt; &lt;/div&gt;&lt;/div&gt;\n\n&lt;!-- Button --&gt;\n&lt;div class=&quot;col-12&quot;&gt;\n     &lt;div class=&quot;form-action&quot;&gt;\n        &lt;button type=&quot;submit&quot; id=&quot;button_1&quot; name=&quot;button_1&quot; class=&quot;btn btn-primary&quot;&gt;Submit&lt;/button&gt;\n    &lt;/div&gt;\n&lt;/div&gt;\n&lt;/fieldset&gt;\n&lt;/form&gt;', NULL, 0, 0, 'wedding-rsvp-form', 1, 1, 1725986926, 1725986926);
COMMIT;

-- ----------------------------
-- Table structure for template_category
-- ----------------------------
DROP TABLE IF EXISTS `template_category`;
CREATE TABLE `template_category` (
  `id` int NOT NULL AUTO_INCREMENT,
  `name` text COLLATE utf8mb4_unicode_520_ci NOT NULL,
  `description` text COLLATE utf8mb4_unicode_520_ci,
  `created_at` int DEFAULT NULL,
  `updated_at` int DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_520_ci;

-- ----------------------------
-- Records of template_category
-- ----------------------------
BEGIN;
INSERT INTO `template_category` (`id`, `name`, `description`, `created_at`, `updated_at`) VALUES (1, 'Online Forms', 'If you need a ready-to-go form for your website, you\'ve come to the right place.', 1725987826, 1725987826);
INSERT INTO `template_category` (`id`, `name`, `description`, `created_at`, `updated_at`) VALUES (2, 'Surveys', 'Curious what people think? Need to do some polling? Then this online surveys are made for you.', 1725987826, 1725987826);
INSERT INTO `template_category` (`id`, `name`, `description`, `created_at`, `updated_at`) VALUES (3, 'Lead Generation', 'A lead generation template is a critical piece of the puzzle on any website designed to attract customer inquiries for follow up.', 1725986926, 1725986926);
INSERT INTO `template_category` (`id`, `name`, `description`, `created_at`, `updated_at`) VALUES (4, 'Invitation', 'Party? Did someone say party? Add a online invitation to your website, or send it out through email, to make collecting responses a snap.', 1725986926, 1725986926);
INSERT INTO `template_category` (`id`, `name`, `description`, `created_at`, `updated_at`) VALUES (5, 'Online Order', 'Are you looking for a way to take orders online instead of over the phone? Well then, what you need is an online order form template.', 1725986926, 1725986926);
INSERT INTO `template_category` (`id`, `name`, `description`, `created_at`, `updated_at`) VALUES (6, 'Registrations', 'Are you an event planner, or has someone \"volunteered\" you to organize that ski lodge reservation for all of your friends? This templates will help you to make organizing events a painless process.', 1725986926, 1725986926);
INSERT INTO `template_category` (`id`, `name`, `description`, `created_at`, `updated_at`) VALUES (7, 'Tracking', 'Spreadsheets are so yesterday for inventory and tracking purposes. Instead of a spreadsheet, you need a tracking form to keep tabs on inventory, host evaluations, file addresses, or even to record your exercise habits.', 1725986926, 1725986926);
COMMIT;

