BEGIN;
INSERT INTO `theme` (`id`, `name`, `description`, `color`, `css`, `shared`, `created_by`, `updated_by`, `created_at`, `updated_at`) VALUES (1, 'Blue Denim', 'Dark blue body with white big fields.', '#212a3e', '\nbody {\n    background-color: #212a3e;\n    padding: 20px;\n    color: #7b8291;\n}\n\n/* Small devices (tablets, 768px and up) */\n@media (min-width: 768px) {\n    body {\n        padding: 50px;\n    }\n}\nstrong {\n    color: #FFFFFF;\n}\nh1 {\n    font-family: \"helvetica\", \"arial\", \"sans-serif\";\n    font-size: 28px;\n    font-weight: 400;\n    line-height: 1.4;\n    color: #fff;\n    margin: 0 0 5px;\n}\np.description {\n    color: #1ec185;\n    background: url(\"data:image/png;base64,\") 0 40% no-repeat;\n    font-size: 14px;\n    padding-left: 20px;\n    display: inline-block;\n    margin: 5px auto 0;\n}\n.form-group {\n    font-size: 14px;\n    color: #7b8291;\n    margin-top: 20px;\n}\n.form-label {\n    font-size: 16px;\n    color: #fff;\n    margin: 0 5px 9px 0;\n}\n.required-control .form-label:after {\n    color: #e55;\n    margin-left: 5px;\n}\n.form-control, .form-select {\n    background: #363e51;\n    border-color: transparent;\n    border-radius: 3px;\n    color: #fff;\n    margin: 0;\n    min-height: 36px;\n    width: 100%;\n    -webkit-transition: background .08s linear;\n    -moz-transition: background .08s linear;\n    -o-transition: background .08s linear;\n    transition: background .08s linear;\n}\n.form-control:hover {\n    background: #424a5b\n}\n.form-control:focus {\n    background: #fff;\n    color: #212a3e\n}\n.form-control::-webkit-input-placeholder {\n    color: #7b8291\n}\n.form-control::-moz-placeholder {\n    color: #7b8291\n}\n.form-control:-ms-input-placeholder {\n    color: #7b8291\n}\n.form-control::placeholder {\n    color: #7b8291\n}\n.btn {\n    border-radius: 4px;\n    border: 0 !important;\n    font-size: 18px;\n    font-weight: 500;\n    width: auto;\n    height: 55px;\n    line-height: 55px;\n    margin: 0;\n    padding: 0 30px;\n    -webkit-transition: background-color .1s ease;\n    -moz-transition: background-color .1s ease;\n    -o-transition: background-color .1s ease;\n    transition: background-color .1s ease;\n}\n.btn-primary {\n    background-color: #1ec185;\n}\n.btn-primary:focus, .btn-primary:active, .btn-primary:hover {\n    background-color: #1baf79 !important;\n    color: #fff;\n    border: 0 !important;\n    outline: 0 none !important;\n    box-shadow: none !important;\n}\n', 0, 1, 1, 1725987826, 1725987826);
INSERT INTO `theme` (`id`, `name`, `description`, `color`, `css`, `shared`, `created_by`, `updated_by`, `created_at`, `updated_at`) VALUES (2, 'Sky Blue', 'Blue sky background with clouds around. White form with a thin typography.', '#95D6FE', '\n@import url(https://fonts.googleapis.com/css?family=Roboto:400,300);\nbody {\n    background-color: #95D6FE;\n    overflow-x: hidden;\n    padding: 20px;\n    color: #A9A9A9;\n    color: rgba(255, 255, 255, 0.6);\n    font-family: Roboto, sans-serif;\n}\n/* Small devices (tablets, 768px and up) */\n@media (min-width: 768px) {\n    body {\n        padding: 50px 25%;\n    }\n}\n/**\n * Form\n */\nh1 {\n    color: #FFFFFF;\n    font-size: 32px;\n    font-weight: 300;\n    text-align: center;\n    margin: .3em 0;\n    -webkit-animation: titleFadein .8s ease;\n    -moz-animation: titleFadein .8s ease;\n    animation: titleFadein .8s ease;\n}\np:first-of-type {\n    color: #FFFFFF;\n    color: rgba(255, 255, 255, 0.92);\n    font-weight: 300;\n    font-size: 20px;\n    text-shadow: none;\n    text-align: center;\n}\n.form-group {\n    background-color: #ffffff;\n    font-size: 14px;\n    padding: 40px 40px 0px;\n    margin: 0;\n}\n.row>div {\n    padding: 0;\n}\n.row div:first-of-type .form-group {\n    padding-top: 40px;\n    margin-top: 40px;\n}\n.form-action {\n    margin: 0;\n    padding: 40px 40px 40px 40px;\n    background-color: #ffffff;\n    font-size: 14px;\n}\n.form-label {\n    font-weight: 300;\n    font-size: 16px;\n    color: #777777;\n}\n.form-control {\n    width: 100%;\n    height: 48px;\n    -webkit-box-sizing: padding-box;\n    -moz-box-sizing: padding-box;\n    box-sizing: padding-box;\n    -webkit-appearance: none;\n    -moz-appearance: none;\n    appearance: none;\n    background-color: #EFEFEF;\n    background-color: rgba(0, 0, 0, 0.03);\n    border-color: transparent;\n    border-radius: 6px;\n    font-size: 20px;\n    font-family: Roboto, sans-serif;\n    font-weight: 300;\n    box-shadow: inset 0px 2px 1px rgba(0, 0, 0, .03);\n    outline: none;\n    text-overflow: ellipsis;\n    -webkit-font-smoothing: antialiased;\n}\n.form-control:focus {\n    border-color: rgb(138, 197, 65);\n    box-shadow: inset 0 0 0 0,inset 0 1px 2px rgba(138, 197, 65, 0.15),0 0 10px rgba(138, 197, 65, 0.8),0 2px 0 rgba(138, 197, 65,0.1);\n    transition: none;\n}\n.form-control::-webkit-input-placeholder {\n    color: #A9A9A9;\n}\n.form-control::-moz-placeholder {\n    color: #A9A9A9;\n}\n.form-control:-ms-input-placeholder {\n    color: #A9A9A9;\n}\n.form-control::placeholder {\n    color: #A9A9A9;\n}\n.radio label, .checkbox label {\n    color: #7C7C7C;\n    font-weight: 300;\n}\n.btn {\n    display: block;\n    padding: 0 28px;\n    border-radius: 28px;\n    width: auto;\n    height: 56px;\n    margin: 0 auto;\n    overflow: hidden;\n    -webkit-font-smoothing: antialiased;\n    font-size: 24px;\n}\n.btn-primary {\n    background-color: rgb(138, 197, 65);\n    background-color: rgba(138, 197, 65, 0.90);\n    border-color: transparent;\n}\n.btn-primary:focus, .btn-primary:hover {\n    background: rgb(138, 197, 65) !important;\n    border-color: transparent !important;\n    color: rgb(255, 255, 255) !important;\n}\n.info {\n    font-size: 16px;\n    color: rgb(102, 102, 102);\n    color: rgba(102, 102, 102, 0.3);\n    padding: 10px 40px;\n    background-color: #ffffff;\n    margin: 0;\n}\n/**\n * Clouds\n *\n * You must add this snippet to your form:\n *\n * <div id=\"clouds\">\n *   <div class=\"cloud x1\"></div>\n *   <div class=\"cloud x2\"></div>\n *   <div class=\"cloud x3\"></div>\n *   <div class=\"cloud x4\"></div>\n *   <div class=\"cloud x5\"></div>\n * </div>\n *\n * Based on http://thecodeplayer.com/walkthrough/pure-css3-animated-clouds-background\n */\n#clouds{\n    top: 220px;\n    padding: 100px 0;\n    position: absolute;\n    z-index: -1;\n}\n/*Time to finalise the cloud shape*/\n.cloud {\n    width: 200px; height: 60px;\n    background: #fff;\n\n    border-radius: 200px;\n    -moz-border-radius: 200px;\n    -webkit-border-radius: 200px;\n\n    position: relative;\n}\n.cloud:before, .cloud:after {\n    content: \"\";\n    position: absolute;\n    background: #fff;\n    width: 100px; height: 80px;\n    top: -15px; left: 10px;\n\n    border-radius: 100px;\n    -moz-border-radius: 100px;\n    -webkit-border-radius: 100px;\n\n    -webkit-transform: rotate(30deg);\n    transform: rotate(30deg);\n    -moz-transform: rotate(30deg);\n}\n.cloud:after {\n    width: 120px; height: 120px;\n    top: -55px; left: auto; right: 15px;\n}\n/*Time to animate*/\n.x1 {\n    -webkit-animation: moveclouds 15s linear infinite;\n    -moz-animation: moveclouds 15s linear infinite;\n    -o-animation: moveclouds 15s linear infinite;\n}\n/*variable speed, opacity, and position of clouds for realistic effect*/\n.x2 {\n    left: 200px;\n\n    -webkit-transform: scale(0.6);\n    -moz-transform: scale(0.6);\n    transform: scale(0.6);\n    opacity: 0.6; /*opacity proportional to the size*/\n\n    /*Speed will also be proportional to the size and opacity*/\n    /*More the speed. Less the time in \"s\" = seconds*/\n    -webkit-animation: moveclouds 25s linear infinite;\n    -moz-animation: moveclouds 25s linear infinite;\n    -o-animation: moveclouds 25s linear infinite;\n}\n.x3 {\n    left: -250px; top: -200px;\n\n    -webkit-transform: scale(0.8);\n    -moz-transform: scale(0.8);\n    transform: scale(0.8);\n    opacity: 0.8; /*opacity proportional to size*/\n\n    -webkit-animation: moveclouds 20s linear infinite;\n    -moz-animation: moveclouds 20s linear infinite;\n    -o-animation: moveclouds 20s linear infinite;\n}\n.x4 {\n    left: 470px; top: -250px;\n\n    -webkit-transform: scale(0.75);\n    -moz-transform: scale(0.75);\n    transform: scale(0.75);\n    opacity: 0.75; /*opacity proportional to size*/\n\n    -webkit-animation: moveclouds 18s linear infinite;\n    -moz-animation: moveclouds 18s linear infinite;\n    -o-animation: moveclouds 18s linear infinite;\n}\n.x5 {\n    left: -150px; top: -150px;\n\n    -webkit-transform: scale(0.8);\n    -moz-transform: scale(0.8);\n    transform: scale(0.8);\n    opacity: 0.8; /*opacity proportional to size*/\n\n    -webkit-animation: moveclouds 20s linear infinite;\n    -moz-animation: moveclouds 20s linear infinite;\n    -o-animation: moveclouds 20s linear infinite;\n}\n@-webkit-keyframes moveclouds {\n    0% {margin-left: 1600px;}\n    100% {margin-left: -1600px;}\n}\n@-moz-keyframes moveclouds {\n    0% {margin-left: 1600px;}\n    100% {margin-left: -1600px;}\n}\n@-o-keyframes moveclouds {\n    0% {margin-left: 1600px;}\n    100% {margin-left: -1600px;}\n}\n', 0, 1, 1, 1725987826, 1725987826);
INSERT INTO `theme` (`id`, `name`, `description`, `color`, `css`, `shared`, `created_by`, `updated_by`, `created_at`, `updated_at`) VALUES (3, 'Gray Shadow', 'A gray background with a gray form and a bluish green button.', '#eeeeee', '\nbody {\n    background-color: transparent;\n    padding: 0;\n    font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif;\n    font-size: 14px;\n    color: #000;\n}\n/* Small devices (tablets, 768px and up) */\n@media (min-width: 768px) {\n    body.app-form {\n        padding: 50px 24%;\n        background-color: #eeeeee;\n    }\n}\nform {\n    border-style: solid;\n    background-image: -moz-linear-gradient(top, rgba(255, 255, 255, 1), rgba(242, 242, 242, 1));\n    background-image: linear-gradient(top, rgba(255, 255, 255, 1), rgba(242, 242, 242, 1));\n    background-image: -webkit-linear-gradient(top, rgba(255, 255, 255, 1), rgba(242, 242, 242, 1));\n    background-repeat: no-repeat;\n    background-position: center center;\n    background-size: 100% 100%;\n    padding: 15px 25px;\n    border-radius: 1px;\n    box-shadow: 0px 0px 0px 0px rgba(50, 50, 50, 0.75);\n    border-width: 4px;\n    border-color: rgb(232,232,232);\n}\nh1 {\n    text-align: center;\n    color: rgb(89,89,89);\n    font-size: 40px;\n}\np.description {\n    text-align: center;\n    color: rgb(51, 51, 51);\n    font-size: 17px;\n}\np.info {\n    color: rgba(107,107,107,1);\n    font-size: 12px;\n    margin-top: 15px;\n}\n.form-control {\n    height: 100%;\n    -webkit-box-sizing: padding-box;\n    -moz-box-sizing: padding-box;\n    box-sizing: padding-box;\n    -webkit-appearance: none;\n    -moz-appearance: none;\n    appearance: none;\n    padding: 15px;\n    font-size: 15px;\n    line-height: 15px;\n    color: #000;\n}\n.form-control:focus {\n    border-color: rgba(117,194,204,1);\n    box-shadow: 0 1px 1px rgba(117,194,204,0.75) inset, 0 0 8px rgba(134,215,225,1);\n    outline: 0 none;\n}\n.form-control::-webkit-input-placeholder { color: #a1a1a1; }\n.form-control:-moz-placeholder { color: #a1a1a1; }\n.form-control::-moz-placeholder { color: #a1a1a1; }\n.form-control:-ms-input-placeholder { color: #a1a1a1; }\n.btn {\n    color: rgba(255,255,255,1);\n    font-size: 19px;\n    background-image: -webkit-linear-gradient(top, rgba(134,215,225,1), rgba(117,194,204,1));\n    padding: 11px;\n    border-radius: 0px;\n    border: transparent;\n    box-shadow: none;\n}\n.btn:focus, .btn:hover, input.btn:active {\n    background-image: -webkit-linear-gradient(bottom, rgba(134,215,225,1), rgba(117,194,204,1));\n    color: rgba(255, 255, 255, 1);\n    box-shadow: none !important;\n    outline: 0 none !important;\n    border-color: transparent;\n}\n.inline-form .form-control {\n    display: inline-block;\n}\n', 0, 1, 1, 1725987826, 1725987826);
INSERT INTO `theme` (`id`, `name`, `description`, `color`, `css`, `shared`, `created_by`, `updated_by`, `created_at`, `updated_at`) VALUES (4, 'Light Gray', 'Light gray form over dark gray body, big fields with a green button.', '#a9a9a9', '\n@import url(https://fonts.googleapis.com/css?family=PT+Sans:400);\n@import url(https://fonts.googleapis.com/css?family=Oswald:400);\nbody {\n    font-family: \"PT Sans\", sans-serif;\n    padding: 0;\n    background-color: #a9a9a9;\n}\n/* Small devices (tablets, 768px and up) */\n@media (min-width: 768px) {\n    body {\n        padding: 60px 25%;\n    }\n}\nform {\n    padding: 35px;\n    background-color: #f3f3f3;\n    border: 1px solid rgba(0, 0, 0, 0.34);\n    -webkit-box-shadow: 0 3px 9px rgba(0, 0, 0, 0.1);\n    -moz-box-shadow: 0 3px 9px rgba(0, 0, 0, 0.1);\n    box-shadow: 0 3px 9px rgba(0, 0, 0, 0.1);\n    border-radius: 10px;\n    color: #555 !important;\n}\nh1, p {\n    text-align: center;\n    font-size: 16px;\n}\nh1 {\n    margin: 5px;\n    padding: 10px 0 0 0;\n    font-size: 28px;\n    font-family: \"Oswald\", sans-serif;\n    text-shadow: 2px 2px 3px rgba(255,255,255,0.1);\n}\np.description {\n    padding: 5px 0 24px 0;\n}\n.note {\n    padding: 24px;\n    margin: 10px 0;\n}\n.form-group {\n    margin-bottom: 1px;\n    position: relative;\n}\n.form-action {\n    margin-top: 25px;\n}\n.form-label {\n    font-size: 16px;\n    margin: 15px 0 0 0;\n}\n.btn {\n    padding: 12px 18px;\n    width: 100%;\n    border: transparent;\n    -webkit-border-radius: 5px;\n    -moz-border-radius: 5px;\n    border-radius: 5px;\n    height: 60px;\n    font-size: 20px;\n    text-shadow: 0 0 #000;\n    -webkit-transition: background-color .1s ease;\n    transition: background-color .1s ease;\n}\n.btn-primary {\n    background-color: #1ec185;\n}\n.btn-primary:focus, .btn-primary:active, .btn-primary:hover {\n    background-color: #1baf79 !important;\n    border-color: transparent;\n    color: #fff;\n}\n.form-control {\n    font-size: 16px;\n    color: #6f6f6f;\n    border: 2px solid #FFFFFF;\n    height: 52px;\n}\n.form-control:focus {\n    border: 2px solid rgb(30, 193, 133);\n    border: 2px solid rgba(30, 193, 133, 0.8);\n    box-shadow: none;\n    outline: 0 none;\n}\n.form-group-icon:before {\n    position: absolute;\n    font-family: \"Glyphicons Regular\";\n    font-size: 36px;\n    color: darkgray;\n    top: 38px;\n    left: 10px;\n}\n.form-group-icon .form-control {\n    padding: 15px 12px 12px 52px;\n}\n.user-icon:before {\n    content: \"\\e004\";\n}\n.email-icon:before {\n    content: \"\\2709\";\n}\n.phone-icon:before {\n    content: \"\\e164\";\n}\n', 0, 1, 1, 1725987826, 1725987826);
INSERT INTO `theme` (`id`, `name`, `description`, `color`, `css`, `shared`, `created_by`, `updated_by`, `created_at`, `updated_at`) VALUES (5, 'Flower Shop', 'Yellow form over Green texture. Orange header and button.', '#FBEFBF', '\n@import url(https://fonts.googleapis.com/css?family=Source+Sans+Pro:400,700);\n\nbody {\n    font-family: \"Source Sans Pro\", sans-serif;\n    font-size: 16px;\n    padding: 0;\n}\n/* Small devices (tablets, 768px and up) */\n@media (min-width: 768px) {\n    body {\n        padding: 50px 25%;\n        background: url(\"../static_files/images/themes/flower-shop.jpg\") repeat #AFC86A;\n    }\n}\nform {\n    background-color: rgb(251, 239, 191);\n    padding: 0 20px 50px 20px;\n    padding-top: 20px;\n}\n/* Small devices (tablets, 768px and up) */\n@media (min-width: 768px) {\n    form {\n        -webkit-box-shadow: 1px 0 11px rgba(50,50,50,0.74);\n        -moz-box-shadow: 1px 0 11px rgba(50,50,50,0.74);\n        box-shadow: 1px 0 11px rgba(50,50,50,0.74);\n    }\n}\nh1 {\n    font-size: 33px;\n    margin: 0 0 25px 0;\n    padding: 15px 0;\n    text-align: center;\n    background-color: rgba(251, 89, 39, 0.9);\n    color: white;\n    font-weight: 700;\n    text-shadow: -1px -1px 0 rgba(184, 60, 42, 0.5),\n    -2px -2px 1px rgba(184, 60, 42, 0.5);\n}\n.form-control, .form-select {\n    height: 42px;\n    border: 3px solid rgb(236, 217, 142);\n}\n.form-control:focus {\n    border-color: rgb(253, 186, 144);\n    box-shadow: 0 1px 1px rgba(253, 186, 144, 0.75) inset, 0 0 8px rgba(253, 186, 144, 1);\n    outline: 0 none;\n}\n.form-control::-webkit-input-placeholder { color: #313941; color: rgba(49, 57, 65, 0.72); }\n.form-control:-moz-placeholder { color: #313941; color: rgba(49, 57, 65, 0.72); }\n.form-control::-moz-placeholder { color: #313941; color: rgba(49, 57, 65, 0.72); }\n.form-control:-ms-input-placeholder { color: #313941; color: rgba(49, 57, 65, 0.72); }\n.control-label {\n    font-weight: bold;\n    margin-top: 15px;\n}\n.btn {\n    background-color: rgb(251, 89, 39);\n    border: transparent;\n    width: 100%;\n    margin-top: 15px;\n    font-size: 22px;\n    padding: 8px 0 8px 0;\n    -webkit-border-radius: 3px;\n    -moz-border-radius: 3px;\n    border-radius: 3px;\n    text-shadow: -1px -1px 0 rgba(184, 60, 42, 0.5),\n    -2px -2px 1px rgba(184, 60, 42, 0.5);\n}\n.btn:focus, .btn:active, .btn:focus:active {\n    outline: none;\n    background-color:#f14c26 !important;\n    box-shadow: 0 1px 1px rgba(253, 186, 144, 0.75) inset, 0 0 8px rgba(253, 186, 144, 1);\n}\n.btn:hover{\n    background-color:#fe6a48 !important;\n}\n', 0, 1, 1, 1725987826, 1725987826);
INSERT INTO `theme` (`id`, `name`, `description`, `color`, `css`, `shared`, `created_by`, `updated_by`, `created_at`, `updated_at`) VALUES (6, 'White Smoke', 'Clean design for multiple purposes. Wide fields with a blue button and without shadows.', '#2B8DD6', '\n@import url(https://fonts.googleapis.com/css?family=Open+Sans:400,600);\n@import url(https://fonts.googleapis.com/css?family=Raleway:400,600);\nbody {\n    background-color: #fbfcfd;\n    padding: 20px;\n    font-family: \"Open Sans\", Helvetica, Arial, sans-serif;\n}\n.legend {\n    font-family: \"Raleway\", \"Helvetica Neue\", Helvetica, Arial, sans-serif;\n    font-size: 20px;\n    font-weight: 600;\n    color: #515151;\n}\n.form-control {\n    font-family: \"Open Sans\", \"Helvetica Neue\", Helvetica, Arial, sans-serif;\n    font-weight: 400;\n    height:55px;\n	border-radius:3px;\n	border-color:#d3d3d3;\n}\n.form-control:focus {\n    border:1px solid #2b8dd6;\n    box-shadow: none;\n    outline: 0 none;\n}\n.form-control::-webkit-input-placeholder { color: #797979; }\n.form-control:-moz-placeholder { color: #797979; }\n.form-control::-moz-placeholder { color: #797979; }\n.form-control:-ms-input-placeholder { color: #797979; }\n.control-label {\n	font-weight: 600;\n}\n.btn {\n    background-color: #2b8dd6;\n    box-sizing: border-box !important;\n    border: 0 !important;\n    border-bottom: 3px solid rgba(0, 0, 0, 0.1) !important;\n    font-family: \"Open Sans\", \"Helvetica Neue\", Helvetica, Arial, sans-serif;\n    font-weight: 600;\n    box-shadow: 0 0 0 !important;\n    padding: 16px 32px;\n}\n.btn:hover, .btn:active, .btn:focus {\n    background-color: #2b8dd6;\n    opacity:0.85;\n	border:0 !important;\n	border-bottom:3px solid rgba(0, 0, 0, 0.1) !important;\n}\n', 0, 1, 1, 1725987826, 1725987826);
INSERT INTO `theme` (`id`, `name`, `description`, `color`, `css`, `shared`, `created_by`, `updated_by`, `created_at`, `updated_at`) VALUES (7, 'Habitat', 'Beauty gradient with a semi-transparent text.', '#1274a3', '\n@import url(https://fonts.googleapis.com/css?family=Open+Sans:300,400,600,700);\n@import url(https://fonts.googleapis.com/css?family=Raleway:400,700);\n/**\n * Design inspired in https://habitat.inkling.com/signup\n */\nhtml {\n    height: 100%;\n}\nbody {\n    height: 100%;\n    margin: 0;\n    background: linear-gradient(135deg, #1274a3 0%,#68ad74 100%);\n    background-repeat: no-repeat;\n    background-attachment: fixed;\n    padding: 20px;\n    font-family: \"Open Sans\", Helvetica, Arial, sans-serif;\n    color: rgb(255, 255, 255);\n    color: rgba(255, 255, 255, 0.75098);\n}\n.legend {\n    font-family: \"Raleway\", \"Helvetica Neue\", Helvetica, Arial, sans-serif;\n    font-size: 26px;\n    font-weight: 400;\n    color: #FFFFFF;\n    color: rgb(255, 255, 255);\n}\np, .checkbox-inline, .radio-inline {\n    font-weight: 300;\n}\n.form-control {\n    font-family: \"Open Sans\", \"Helvetica Neue\", Helvetica, Arial, sans-serif;\n    font-weight: 400;\n    transition: box-shadow 150ms ease-in-out;\n    background-color: rgb(10,13,25);\n    background-color: rgba(10,13,25,0.1);\n    border-radius: 3px;\n    outline: solid 2px rgba(255,255,255,0);\n    border-color: transparent;\n    box-shadow: inset 0 1px 1px rgba(10,13,25,0.15),0 1px 0 rgba(255,255,255,0.1);\n    box-sizing: border-box;\n    font-family: inherit;\n    font-size: 16px;\n    height: 45px;\n    width: 100%;\n    color: #FFFFFF;\n    color: rgba(255, 255, 255, 0.92098);\n}\n.form-control:focus {\n    background-color: rgb(10,13,25);\n    background-color: rgba(10,13,25,0.1);\n    box-shadow: inset 0 0 0 1px #fff,inset 0 1px 2px rgba(10,13,25,0.15),0 0 8px rgba(255,255,255,0.5),0 1px 0 rgba(255,255,255,0.1);\n    transition: none;\n}\n.form-control option {\n    background-color: #1274a3;\n}\n.form-control::-webkit-input-placeholder {\n    color: #FFFFFF;\n    color: rgba(255,255,255,0.35);\n}\n.form-control:-moz-placeholder {\n    color: #FFFFFF;\n    color: rgba(255,255,255,0.35);\n}\n.form-control::-moz-placeholder {\n    color: #FFFFFF;\n    color: rgba(255,255,255,0.35);\n}\n.form-control:-ms-input-placeholder {\n    color: #FFFFFF;\n    color: rgba(255,255,255,0.35);\n}\n.control-label {\n	font-weight: 600;\n}\n.required-control .control-label:after {\n    color: rgb(255, 255, 255) !important;\n    color: rgba(255, 255, 255, 0.75098) !important;\n}\n.btn {\n    box-sizing: border-box !important;\n    border: 0 !important;\n    border-bottom: 3px solid rgba(0, 0, 0, 0.1) !important;\n    font-family: \"Open Sans\", \"Helvetica Neue\", Helvetica, Arial, sans-serif;\n    font-weight: 600;\n    text-shadow: 0 -1px 0 rgba(255,255,255,0.1);\n    padding: 16px 32px;\n}\n.btn-primary {\n    background-color: rgb(110,238,215);\n    background-color: rgba(110,238,215,0.65);\n    box-shadow: inset 0 -2px 0 rgba(0,0,0,0.3),inset 0 1px 0 rgba(255,255,255,0.07),0 1px 1px rgba(10,13,25,0.5);\n}\n.btn-primary:hover, .btn-primary:active, .btn-primary:focus {\n    background-color: rgb(110,238,215) !important;\n    background-color: rgba(110,238,215,0.45) !important;\n    box-shadow: inset 0 -2px 0 rgba(0,0,0,0.3),inset 0 1px 0 rgba(255,255,255,0.07),0 1px 1px rgba(10,13,25,0.5) !important;\n    outline: 0 none !important;\n}\n/**\n * Alerts\n */\n.alert-success {\n    background-color: #68ad74;\n    border-color: #1274a3;\n}\n.alert-danger {\n    background-color: #ff7332;\n    border-color: #1274a3;\n}\n.has-error .help-block, .has-error .control-label, .has-error .radio, .has-error .checkbox,\n.has-error .radio-inline, .has-error .checkbox-inline, .has-error.radio label,\n.has-error.checkbox label, .has-error.radio-inline label, .has-error.checkbox-inline label {\n    color: #FFFFFF;\n}\n.has-error .help-block {\n    margin: 0;\n    padding: 5px 10px;\n    color: #FFF;\n}\n.has-error .form-control {\n    border-color: #ff7332;\n}\n', 0, 1, 1, 1725987826, 1725987826);
INSERT INTO `theme` (`id`, `name`, `description`, `color`, `css`, `shared`, `created_by`, `updated_by`, `created_at`, `updated_at`) VALUES (8, 'Blue Dress', 'A beauty dark theme with subtle shadow, green button and and active fields.', '#374151', '\n@import url(https://fonts.googleapis.com/css?family=Open+Sans:400,600);\n@import url(https://fonts.googleapis.com/css?family=Raleway:400,600);\nbody {\n    background-color: #374151;\n    padding: 20px;\n    font-family: \"Open Sans\", Helvetica, Arial, sans-serif;\n    color: #FBFEFB;\n    color: rgba(255, 255, 255, 0.82098);\n}\n.legend {\n    font-family: \"Raleway\", \"Helvetica Neue\", Helvetica, Arial, sans-serif;\n    font-size: 28px;\n    font-weight: 400;\n    margin-bottom: 25px;\n    color: #FBFEFB;\n}\n.form-control {\n    font-family: \"Open Sans\", \"Helvetica Neue\", Helvetica, Arial, sans-serif;\n    font-weight: 400;\n    transition: box-shadow 150ms ease-in-out;\n    background-color: rgba(10,13,25,0.1);\n    border-radius: 5px;\n    outline: solid 2px rgba(255,255,255,0);\n    border: 2px solid transparent;\n    box-shadow: inset 0 1px 1px rgba(10,13,25,0.15),0 1px 0 rgba(255,255,255,0.1);\n    box-sizing: border-box;\n    font-family: inherit;\n    font-size: 16px;\n    height: 43px;\n    width: 100%;\n    color: #FFFFFF;\n    color: rgba(255, 255, 255, 0.82098);\n}\n.form-control:focus {\n    border:2px solid #95B366;\n    box-shadow: none;\n    outline: 0 none;\n    background-color: rgba(10,13,25,0.1);\n}\n.form-control option {\n    background-color: #374151;\n}\n.form-control::-webkit-input-placeholder { color: #4A566A; }\n.form-control:-moz-placeholder { color: #4A566A; }\n.form-control::-moz-placeholder { color: #4A566A; }\n.form-control:-ms-input-placeholder { color: #4A566A; }\n.control-label {\n    color: #FBFEFB;\n	font-weight: 600;\n}\n.btn {\n    box-sizing: border-box !important;\n    border: 0 !important;\n    border-bottom: 3px solid rgba(0, 0, 0, 0.1) !important;\n    font-weight: 600;\n    padding: 9px 32px;\n    font-family: \"Open Sans\", \"Helvetica Neue\", Helvetica, Arial, sans-serif;\n}\n.btn-primary {\n    background-color: #95B366;\n}\n.btn-primary:hover, .btn-primary:active, .btn-primary:focus {\n    background-color: #95B366 !important;\n    opacity:0.85;\n	box-shadow: none;\n    outline: 0 none;\n}\n', 0, 1, 1, 1725987826, 1725987826);
INSERT INTO `theme` (`id`, `name`, `description`, `color`, `css`, `shared`, `created_by`, `updated_by`, `created_at`, `updated_at`) VALUES (9, 'Tea Time', 'Beautiful theme inspired by a cup of tea. With strong contrasts, a transparent black background and white letters, you can see a picture.', '#000000', '\n@import url(https://fonts.googleapis.com/css?family=Open+Sans:300,400,600,700);\n@import url(https://fonts.googleapis.com/css?family=Raleway:400,600);\nbody {\n    background-color: transparent;\n    background: url(\"../static_files/images/themes/tea-time.jpg\") no-repeat center center fixed;\n    -webkit-background-size: cover;\n    -moz-background-size: cover;\n    -o-background-size: cover;\n    background-size: cover;\n    font-family: \"Open Sans\", Helvetica, Arial, sans-serif;\n    color: #FFFFFF;\n}\nform {\n    background-color: rgb(0, 0, 0);\n    background-color: rgba(0, 0, 0, 0.75);\n    padding: 20px;\n}\n/* Small devices (tablets, 768px and up) */\n@media (min-width: 768px) {\n    /* Hide background image of the body in embed view */\n    .app-embed {\n        background: transparent;\n    }\n    form {\n        padding: 40px;\n    }\n}\nh1 {\n    font-family: \"Raleway\", \"Helvetica Neue\", Helvetica, Arial, sans-serif;\n    font-size: 28px;\n    font-weight: 600;\n    margin: 0 0 20px 0;\n}\np, .form-check-inline {\n    font-weight: 300;\n}\n.form-group, .form-action {\n    margin-bottom: 25px;\n}\n.form-control {\n    font-family: \"Open Sans\", \"Helvetica Neue\", Helvetica, Arial, sans-serif;\n    color: #FFFFFF;\n    border: 1px solid #FFFFFF;\n    background-color: #000000;\n    background-color: rgba(0, 0, 0, 0);\n    height: 42px;\n}\n.form-control:focus {\n    color: #FFFFFF;\n    background-color: transparent;\n    border-color: #F9690E;\n    box-shadow: none;\n    outline: 0 none;\n    transition: none;\n}\n.form-control::-webkit-input-placeholder {\n    color: #D2D7D3;\n    color: rgba(255,255,255,0.85);\n}\n.form-control:-moz-placeholder {\n    color: #D2D7D3;\n    color: rgba(255,255,255,0.65);\n}\n.form-control::-moz-placeholder {\n    color: #D2D7D3;\n    color: rgba(255,255,255,0.65);\n}\n.form-control:-ms-input-placeholder {\n    color: #D2D7D3;\n    color: rgba(255,255,255,0.65);\n}\n.form-label {\n	font-weight: 600;\n}\n.btn {\n    border-radius: 26px;\n    font-family: \"Open Sans\", \"Helvetica Neue\", Helvetica, Arial, sans-serif;\n    font-weight: 600;\n    padding: 12px 42px;\n}\n.btn-primary {\n    border-color: transparent;\n    background-color: #F9690E;\n}\n.btn-primary:hover, .btn-primary:active, .btn-primary:focus {\n    border-color: transparent !important;\n    background-color: #fa7d2e !important;\n    box-shadow: none !important;\n    outline: 0 none !important;\n}\n/**\n * Alerts\n */\n.alert-success {\n    background-color: #018930;\n    background-color: rgba(1,137,48,0.75);\n    border-color: #018930;\n}\n.alert-danger {\n    background-color: #FF0000;\n    background-color: rgba(255, 0, 0, 0.75);\n    border-color: #FF0000;\n}\n', 0, 1, 1, 1725987826, 1725987826);
INSERT INTO `theme` (`id`, `name`, `description`, `color`, `css`, `shared`, `created_by`, `updated_by`, `created_at`, `updated_at`) VALUES (10, 'Purple Bay', 'A purple translucent theme with white fields and blue button.', '#2b2c4e', '\n@import url(https://fonts.googleapis.com/css?family=Open+Sans:300,400,600,700);\n@import url(https://fonts.googleapis.com/css?family=Raleway:300,400);\nbody {\n    padding: 20px;\n    background-color: transparent;\n    background: url(\"../static_files/images/themes/purple-bay.jpg\") no-repeat center center fixed;\n    -webkit-background-size: cover;\n    -moz-background-size: cover;\n    -o-background-size: cover;\n    background-size: cover;\n    font-family: \"Open Sans\", Helvetica, Arial, sans-serif;\n    color: #cdcdcd;\n    color: rgba(255,255,255,0.80);\n}\n/* Small devices (tablets, 768px and up) */\n@media (min-width: 768px) {\n    .app-embed {\n        padding: 50px 25%;\n    }\n}\n.legend {\n    display: inline-block;\n    font-family: \"Raleway\", \"Helvetica Neue\", Helvetica, Arial, sans-serif;\n    font-size: 24px;\n    font-weight: 300;\n    text-transform: uppercase;\n    padding-bottom: 3px;\n    border-bottom: 2px solid #1762ee;\n    margin: 0 0 20px 0;\n    color: #ffffff;\n}\n/* Small devices (tablets, 768px and up) */\n@media (min-width: 768px) {\n    .legend {\n        font-size: 28px;\n    }\n}\np {\n    font-weight: 300;\n}\n.form-group, .form-action {\n    margin-bottom: 25px;\n}\n.form-control, .form-select {\n    font-family: \"Open Sans\", \"Helvetica Neue\", Helvetica, Arial, sans-serif;\n    color: #FFFFFF;\n    border-color: transparent;\n    background-color: #000000;\n    background-color: rgba(255, 255, 255, 0.15);\n    height: 42px;\n}\n.form-control:focus {\n    border-color: #ffffff;\n    border-color: rgba(255, 255, 255, 0.30);\n    box-shadow: none;\n    outline: 0 none;\n    transition: none;\n}\n.form-control::-webkit-input-placeholder {\n    color: #D2D7D3;\n    color: rgba(255,255,255,0.85);\n}\n.form-control:-moz-placeholder {\n    color: #D2D7D3;\n    color: rgba(255,255,255,0.65);\n}\n.form-control::-moz-placeholder {\n    color: #D2D7D3;\n    color: rgba(255,255,255,0.65);\n}\n.form-control:-ms-input-placeholder {\n    color: #D2D7D3;\n    color: rgba(255,255,255,0.65);\n}\n.control-label, .checkbox-inline, .radio-inline {\n    color: #cdcdcd;\n    color: rgba(255,255,255,0.80);\n	font-weight: 400;\n}\n.control-label {\n	text-transform: uppercase;\n}\n.btn {\n    font-family: \"Open Sans\", \"Helvetica Neue\", Helvetica, Arial, sans-serif;\n    font-weight: 600;\n    padding: 12px 42px;\n}\n.btn-primary {\n    border-color: transparent;\n    background-color: #1762ee;\n}\n.btn-primary:hover, .btn-primary:active, .btn-primary:focus {\n    border-color: transparent !important;\n    background-color: #3375f0 !important;\n    box-shadow: none !important;\n    outline: 0 none !important;\n}\n/**\n * Alerts\n */\n.alert-success {\n    background-color: #018930;\n    background-color: rgba(1,137,48,0.75);\n    border-color: #018930;\n}\n.alert-danger {\n    background-color: #FF0000;\n    background-color: rgba(255, 0, 0, 0.75);\n    border-color: #FF0000;\n}\n', 0, 1, 1, 1725987826, 1725987826);
COMMIT;

